// import logo from './logo.svg';
import './App.css';
import './Demo.css';

let user ={
  name:"Shivani Shinde",
  imageUrl:'https://i.imgur.com/yXOvdOSs.jpg',
  imageSize:90,

}

function App() {
  return (
    <div classNameName="blank">
      {/* <h1>{user.name}</h1>
      <img classNameName="avatar" src={user.imageUrl} alt={'Photo of'+user.name} style={{width:user.imageSize,height:user.imageSize}} />
      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Ullam assumenda possimus, alias et omnis iure sint harum iusto. Voluptatum optio quibusdam voluptate expedita consequuntur eius suscipit repellendus soluta laudantium qui.</p>
